import Pagina_Validacion from './Componentes/Pagina_Validacion';
import './App.css';
import ReactDOM from 'react-dom';
import Pagina_Principal from './Componentes/Pagina_Principal';
import { Route, Router, Routes } from 'react-router-dom';
import P_Principal from './Componentes/Pagina_Principal';
import P_Productos from './Componentes/Pagina_Productos';
import { BrowserRouter } from 'react-router-dom';

function App(){
  return(
    <BrowserRouter>
      <div className='contenedor_pagina'>
      <Routes>
        <Route path='/Pagina_Principal' element={<P_Principal />} />
        <Route path='/Pagina_Productos' element={<P_Productos />} />
      </Routes>
      </div>

    </BrowserRouter>
  );
}
export default App;
